import "../styles/App.css";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import { Home, Login, Signup } from "../pages";
import {Navbar} from './'

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>

          <Route exact path="/login">
            <Login />
          </Route>

          <Route exact path="/signup">
            <Signup />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
